def fit_plot_gaussians(data, num_distributions=3):
    # Generate points on the x axis
    x_values = np.linspace(min(data), max(data), 1000)

    # Using K-Means to find initial guesses for means
    # kmeans = KMeans(n_clusters=num_distributions, random_state=0).fit(np.array(data).reshape(-1, 1))
    means = [40,60,120]

    # Standard deviations - starting with a guess (can be fine-tuned)
    stds = [np.std(data) / 2 for _ in range(num_distributions)]

    # Fit Gaussian distributions
    pdfs = [norm.pdf(x_values, mean, std) for mean, std in zip(means, stds)]
    plt.figure(figsize=(10, 6))

    # Histogram of frequencies
    counts, bins, patches = plt.hist(data, bins=50, color='skyblue', edgecolor='black', alpha=0.5)

    # scale the pdfs to fit the histogram
    bin_width = bins[1] - bins[0]
    scale_factor = len(data) * bin_width
    scaled_pdfs = [pdf * scale_factor*0.5 for pdf in pdfs]

    # Individual Gaussian distributions
    for pdf, mean in zip(scaled_pdfs, means):
        plt.plot(x_values, pdf, label=f'Gaussian (mean={mean:.2f})')

    # Sum of Gaussian distributions
    sum_pdf = np.sum(scaled_pdfs, axis=0)
    plt.plot(x_values, sum_pdf, label='Sum of Gaussians', color='red')

    # Set titles and labels
    plt.title('Histogram of Widths (W) with Gaussian Fits')
    plt.xlabel('Width')
    plt.ylabel('Frequency')
    plt.grid(True)
    plt.legend()

    plt.show()

# Call the function with the provided W data
fit_plot_gaussians(W)


